import { Fragment } from "react";



const App = () => {

  const arak = [
    ["Halberd", "400gp"],
    ["Brass armor", "150gp"]   
  ]

  return (
    <section 
      style={{
      display: "flex",
      width: "100vw",
      height: "100vh",
      justifyContent: "center",
      alignItems: "center"
    }}>
      <button>Arak</button>
      <button>Osaris</button>
      <button>Garrogat</button>

      <ul style={{ listStyle: "none"}}>
      {arak.map((item, i) => {
        return (
          <div style={{ display: "flex" }} key={i}>
            <li style={{ width: "200px"}}>{item[0]}</li>
            <li>{item[1]}</li>
            <div style={{ width: "100%", height: "2px", backgroundColor: "black"}}></div>
          </div>
        )
      })}
      </ul>
    </section>
  )
}

export default App;
